#include <iostream>#include <vector>#include <algorithm>#include <numeric>using namespace std; bool solve(vector<int> &nums){      const int n = nums.size();        for(int i=0;i<n;i++)      {            for(int j=i+1;j<n;j++)            {                  if(gcd(nums[i],nums[j])<=2)                  {                        return true;                   }            }      }      return false;} int main() {       int t;      cin >> t;      while (t-- > 0)      {            int n;            cin >> n;             vector<int> nums(n, 0);             for (int i = 0; i < n; i++)            {                  int temp;                  cin >> temp;                  nums[i] = temp;            }            if (solve(nums))            {                  cout << "Yes" << endl;            }            else            {                  cout << "No" << endl;            }      }       return 0;}